import React from "react";
import custom from "./images/custom.jpg";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const KeepHeader = () => {
    return (
        <>
            <header>
                <img width = "80" height = "70" src = {custom} alt= "keepLogo"/>
                <h1 className = "text-capitalize display-4 px-5">Tarun Kushwaha</h1>
            </header>
        </>
    );
}

export default KeepHeader;
